Jetsons: The Movie is a 1990 American animated science fiction film produced by Hanna-Barbera Productions and released by Universal Pictures based on the hit cartoon series, The Jetsons. The movie features the final film roles for both George O'Hanlon (the voice of George Jetson) and Mel Blanc (the voice of Mr. Spacely and various other Hanna-Barbera/Looney Tunes characters), who both died during production of the film. The movie is dedicated to both their memories.





